import fetch from "./fetchWithTimeout";

export const baseUrl = () => "http://localhost:3000/api";

export const fetcher = (url: string) => fetch(url, 2000).then((res) => res.json());

export interface IEmployee {
    id: string;
    name: string;
    surname: string;
    dateOfBirth: string;
    position: string;
    phoneNumber: string;
}
